import React, { useState } from 'react';
import ProtCharacter from './ProtCharacter';

export default props => {
    const [spriteY, setSpriteY] = useState();

    function onKeyLeft() {
        setSpriteY(5);
    }

    window.addEventListener('keypress', onKeyLeft);

    return <ProtCharacter x={50} y={props.y} deviation={0}
    />

}
